import biryani from '../biryani.jpg'
const foodImages = [
  {
    type:'pizzas',
    
    image: <img src="https://www.dominos.co.in/files/items/Pepper_Barbeque.jpg" className='img-fluid' alt="Pepperoni Pizza" style={{ height: "200px", width: "200px" }} />
  },
  {
    type:'biryani',
    image:<img src="https://www.cookwithmanali.com/wp-content/uploads/2019/09/Vegetable-Biryani-Restaurant-Style.jpg" className='img-fluid' alt="Pepperoni Pizza" style={{ height: "200px", width: "200px" }} />
  },
  {
    type:'biryani',
    image:<img src="https://www.dominos.co.in/files/items/Veg_Extravaganz.jpg" className='img-fluid' alt="Pepperoni Pizza" style={{ height: "200px", width: "200px" }} />
  }
  // add more objects as needed
]
export default foodImages
